description:
This is a PC videogame. It is made by snagglepop.com and it is their first release. This is version .01b and it is playable though incomplete. It is being distributed for feedback. The game is called Poverty. It is an RPG in an 80's style and though the storyline is almost non-existant at this point it deals with modern themes in a fantasy setting.

To install simply double click the .exe file. there will be a folder with a game launcher inside. Visit our website at snagglepop.com if you have any questions difficulties, or want to see screenshots.

